pragma solidity >=0.6.0;
pragma experimental ABIEncoderV2;

import "./IERC20.sol";
import "./IChi.sol";
import "./BPool.sol";
import "./IUniswapV2Callee.sol";
import "./IUniswapV2Pair.sol";

contract Flashloan is IUniswapV2Callee {
    struct ArbInfo {
        address outerToken;
        address innerToken;
        uint256 outputAmount0;
        uint256 outputAmount1;
        uint256 paybackAmount;
        uint256 inputAmount;
        uint8 exchange; //1:Uni/sushi, 2:bal
        address pool;
    }

    struct ArbInfoParameters {
        address _outerToken;
        address _innerToken;
        uint256 _awayOutput_0;
        uint256 _awayOutput_1;
        uint256 _returnOutput_0;
        uint256 _returnOutput_1;
        uint256 _awayInput;
        uint256 _returnInput;
        uint8 _awayExchange; //1:Uni/sushi, 2:Bal
        uint8 _returnExchange; //1:Uni/sushi, 2:bal
        address _awayPool;
        address _returnPool;
    }

    address payable owner;

    //Create modifier to limit who can call the contract
    modifier onlyOwner() {
        require(msg.sender == owner, "Sender not authorized.");
        // Do not forget the "_;"! It will
        // be replaced by the actual function
        // body when the modifier is used.
        _;
    }

    modifier discountCHI {
        uint256 gasStart = gasleft();
        _;
        uint256 gasSpent = 21000 + gasStart - gasleft() + 16 * msg.data.length;
        ChiToken(0x0000000000004946c0e9F43F4Dee607b0eF1fA1c).freeFromUpTo(
            msg.sender,
            (gasSpent + 14154) / 41947
        );
    }

    //Create address variables for relevant exchanges
    constructor() public payable {
        owner = msg.sender;
    }

    //Withdraws any ethereum from the address
    function withdrawEth() public onlyOwner {
        owner.transfer(address(this).balance);
    }

    //Withdraw a specific ERC20 token
    function withdrawErc20(address token) external onlyOwner {
        IERC20 newToken = IERC20(token);
        newToken.transfer(owner, newToken.balanceOf(address(this)));
    }

    //Change the contract owner
    function changeOwner(address payable newOwner) external onlyOwner {
        owner = newOwner;
    }

    //This functions exchanges sellBalance of sellCoin for buyCoin
    function tradeOnUniSushi(
        uint256 AmountOut0,
        uint256 AmountOut1,
        address pool,
        bytes memory data
    ) private {
        IUniswapV2Pair(pool).swap(AmountOut0, AmountOut1, address(this), data);
    }

    function tradeOnBalancer(
        address sellCoin,
        address buyCoin,
        uint256 sellBalance,
        address pool
    ) private {
        BPool(pool).swapExactAmountIn(
            sellCoin,
            sellBalance, // maxAmountIn, set to max -> use all sent ETH
            buyCoin,
            0, // Min out 0 means we accept any amount
            2**256 - 1 //Max price
        );
    }

    //Callback from uniswap or sushiswap pool flashloan
    function uniswapV2Call(
        address sender,
        uint256 amount0,
        uint256 amount1,
        bytes calldata data
    ) external override {
        ArbInfo memory arbInfo = abi.decode(data, (ArbInfo));
        if (arbInfo.exchange == 1) {
            //Uniswap
            IERC20(arbInfo.outerToken).transfer(arbInfo.pool, arbInfo.inputAmount);
            tradeOnUniSushi(
                arbInfo.outputAmount0,
                arbInfo.outputAmount1,
                arbInfo.pool,
                new bytes(0)
            ); //Regular uni trade
        } else if (arbInfo.exchange == 2) {
            //Bal
            IERC20(arbInfo.outerToken).approve(arbInfo.pool, arbInfo.inputAmount);
            tradeOnBalancer(
                arbInfo.outerToken,
                arbInfo.innerToken,
                arbInfo.inputAmount,
                arbInfo.pool
            );
        }

        //Return owed amount to uniswap/sushiswap
        IERC20(arbInfo.innerToken).transfer(msg.sender, arbInfo.paybackAmount);
    }

    //This is the function that initiates the arbitrage play
    //It withdraws the flashloan from dydx and then calls the callFunction in this contract and then deposits the flashloan back
    function initiateTrade(bytes calldata data) external onlyOwner discountCHI {
        ArbInfoParameters memory AIP = abi.decode(data, (ArbInfoParameters));
        //WE ASSUME EVERY TRADE STARTS WITH UNISWAP AND OPTIMISTICALLY WITHDRAW
        if (AIP._awayExchange == 1) {
            //UNISWAP IS FIRST, SO SWAP ALL THE TOKEN ORDER (NEXT TRADE WILL BE innerToken->outerToken)
            bytes memory arbData =
                abi.encode(
                    ArbInfo({
